          <input
            class="form-control form-control-sm"
            type="text"
            placeholder="Line1"
          />
          <input
            class="form-control form-control-sm my-2"
            type="text"
            placeholder="Line2"
          />
          <input
            class="form-control form-control-sm"
            type="text"
            placeholder="Line3"
          />
        </div>
      </div>
